import React from 'react'
import { Route, Routes} from 'react-router-dom';

export function Navigation() {
  return (
      <Router>
          <Routes>
              {map(routes, (route, index) => (
                  <Route
                      key={index}
                      path={route.path}
                      exact={route.exact}
                      element={
                          <route.layout>
                              <route.component />
                          </route.layout>
                      }
                  />
              ))}
          </Routes>
      </Router>
  );
}
